Представляем вашему вниманию модифицированную сборку YouTube! Установив данную сборку, вы получите: 

- Встроенный твик uYou Plus; 
- Отсутствие рекламы​​​​​; 
- Счетчик дизлайков; 
- Видео до 4К разрешения (Настройки - качество видео - use VP9 codec - перезагружаем YouTube); 
- Темную тему (Настройки - uYouPlus - OLED Keyboard и OLED Dark mode - перезагружаем YouTube); 
- Режим картинка в картинке (при просмотре видео делаем свайп на рабочий стол); 
- Ускорение видео до X3; 
 И многие другие функции!
